import { useState } from 'react';
import { CashInput, Button, ChargeScreenForm } from './ChargeScreen.styled';

export default function ChargeScreen() {
  const [cash, setCash] = useState(0);

  const handleClick = (evt) => {
    evt.preventDefault();
    console.log(cash);
  };

  const handleKeyUpInput = (evt) => {
    const { value } = evt.target;
    setCash(value);
  };

  return (
    <ChargeScreenForm flex>
      <CashInput
        type="text"
        placeholder="금액을 입력하세요"
        flex
        justify="center"
        align="center"
        onKeyUp={handleKeyUpInput}
      ></CashInput>
      <Button flex justify="center" align="center" onClick={handleClick}>
        클릭
      </Button>
    </ChargeScreenForm>
  );
}
